`user script`;function buildMedias(inputURL){const q=inputURL.split("-");const offset=(parseInt(q[1])-1)*20;const url="https://zh.stripchat.com/api/front/models?limit=20&offset="+offset+"&primaryTag=girls&filterGroupTags="+q[0]+"&sortBy=stripRanking";const req={url:url,method:"GET",};$http.fetch(req).then(res=>{const items=JSON.parse(res.body).models;var datas=[];items.forEach(item=>{if(item.status=="public"){const title=item.username;const href=String(item.id);const coverURLString=item.previewUrlThumbBig;const descriptionText="";datas.push(buildMediaData(href,coverURLString,title,descriptionText,href))}});$next.toMedias(JSON.stringify(datas))})}function Episodes(inputURL){let datas=[];const realURL="https://edge-hls.doppiocdn.com/hls/"+inputURL+"/master/"+inputURL+".m3u8";const backupURL="https://b-hls-17.doppiocdn.org/hls/"+inputURL+"/"+inputURL+".m3u8";datas.push(buildEpisodeData("real","主綫路",realURL));datas.push(buildEpisodeData("backup","備用綫路",backupURL));$next.toEpisodes(JSON.stringify(datas))}function Player(inputURL){$next.toPlayer(inputURL)}function Search(inputURL){}